import './App.css';
import {Home} from './Screens/Home';

import {
  BrowserRouter as Router,
  Routes,
  Route,

}from "react-router-dom";
import Login from './Screens/Login';

function App() {
  return (
     <Router>
      <div>
        <Routes>
          <Route exaxt path="/" element={<Home></Home>}> </Route>

          <Route exaxt path="/login" element={<Login></Login>}></Route>

        </Routes>
      </div>

     </Router>
  )
}

export default App;
